import React from 'react';

function Inicio () {
	return (
		<section className="inicio">
			<h2>INICIO</h2>
			<img style="display: block;" src="https://ouch-cdn2.icons8.com/dfkVsUfRhD9T5p1T6oihPZ8w5VDfG3d0Ww_KO5Epc0k/rs:fit:684:456/czM6Ly9pY29uczgu/b3VjaC1wcm9kLmFz/c2V0cy9zdmcvNDE3/LzgyMjBjZDEyLWU4/ZjgtNGI4My1iOTcy/LTk2MjkwODU1NmM2/Mi5zdmc.png" alt="Inicio" />
		</section>
	);
}

export default Inicio;
